import Layout from "../components/Layout";

function Work() {
  return (
    <Layout>
      <h1>Check out my work</h1>
      <div className="projects">
        <div className="project-list">
          <div className="item">
            <img src="/static/project1.png" />
            <h2>Project title</h2>
          </div>
        </div>
      </div>
      <style jsx>{`
        .projects {
          max-width: 1000px;
          margin: 0 auto;
        }

        .project-list {
          padding: 0 30px;
          display: flex;
          flex-wrap: wrap;
          justify-content: space-between;
        }
        .projects .item {
          padding: 20px;
          margin-bottom: 40px;
          width: 50%;
        }

        img{
          width: 50%;
        }
      `}</style>
    </Layout>
  );
}

export default Work;
